import React, { Component } from 'react';

class Interface extends Component {
  constructor(props) {
    super(props);
    this.state = {
      username: "",
      password: ""
    };
  }

  handleUserChange = event => {
    event.preventDefault()
    this.setState({ user: event.target.value });
  }

  handlePasswordChange = event => {
    event.preventDefault()
    this.setState({ password: event.target.value });
  }


  render() {
    return (
      <div className="interface">
        <div className="loginForm">
          <input type="text" className="loginFormField" placeholder="Username" onChange={this.handleUserChange} />
          <input type="password" className="loginFormField" placeholder="Password" onChange={this.handlePasswordChange} />
        </div>
        <div className="enrollAdminForm">Hello</div>
        <div className="registerUserForm">Hello</div>
      </div>
    );
  }
}

export default Interface;
